203: 204: assertEquals("Two", p2.text());
205: List<Node> nodes = p2.siblingNodes();
206: assertEquals(2, nodes.size());
207: assertEquals("<p>One</p>", nodes.get(0).outerHtml());
208: assertEquals("<p>Three</p>", nodes.get(1).outerHtml());
209: }

